import "./Type.css";
import dataType from "../../../../data/type.json";
const Type = () => {
  return (
    <div>
      <h2>Browse by property type</h2>
      <div className="type">
        {dataType.map((item, index) => {
          return (
            <div key={index}>
              <img style={{ src: `${dataType.image}` }} />
              <h3>{dataType.name}</h3>
              <p>{dataType.count}</p>
            </div>
          );
        })}
      </div>
    </div>
  );
};
export default Type;
